    public static int lengthOfLongestSubstring(String s){
        int longestLength=0;

        for(int i=0;i<s.length();i++){
            Integer[] uniqueCharsVal=new Integer[150];
            String currStr="";
            for(int j=i;j<s.length();j++){
                Character currChr=s.charAt(j);


                if(uniqueCharsVal[currChr]!=null)
                   break;

                uniqueCharsVal[currChr]=Integer.valueOf(currChr);
                currStr+=currChr;
                longestLength=Math.max(longestLength,currStr.length());
                if(currStr.length()>longestLength)
                    longestLength=currStr.length();
            }
        }

        return longestLength;
    }



